    # The function that sends the Diagnostic Service Request:
    #     to use - "startDiagnosticSession({CAN_ID}, {sessionType}"
    #     where can ID is sent from tester to ecu ala _DiagSig_Rx
    #     ecuOption() is used to fill _DiagSig_Rx
    #################################################################################################################
    def startDiagnosticSession(_DiagSig_Rx=0x760, sessionType=0x021087):
        """
        Sends request to open a diagnostic session to ecu
        """
        resp = device.query(_DiagSig_Rx, _DiagSig_Rx + 8, sessionType, (8,))
        message = resp
        if resp == None:
            print("No Response From ECU.")
            return
        print("Response:")
        print(message)
        return int.from_bytes(resp[0][3:], "big") 
